export default function Header(){
       return (
        <div className="flex bg-bud bg-cover h-1/4 p-10 h-120 md:h-1/3 lg:h-1/3 xl:h-3/5">
          <div className="bg-transparent flex flex-col justify-start w-min">
              <p id="header-title" className="text-2xl text-green-400 font-bold p-4 md:text-4xl md:p-10">
                Welcome!
              </p>
              <div id="btn-container" className="flex justify-around">
                <button className="bg-purple-600 p-1 rounded text-white text-sml">Login</button>
                <button className="bg-purple-600 p-1 rounded text-white">Signup</button>
              </div>
          </div>
        </div>
       )
}
